Dutch:
Het leven van een stel uit de stad verandert in een nachtmerrie wanneer een angstaanjagende buitenaardse aanwezigheid elke nacht hun huis binnenkomt en zich aan de kinderen te goed doet. Wanneer vrienden en buren zich sceptisch opstellen is het paar gedwongen om het heft in eigen handen te nemen om de familie te redden.

English:
As the Barret family's peaceful suburban life is rocked by an escalating series of disturbing events, they come to learn that a terrifying and deadly force is after them. 

